import React from 'react';
import { motion } from 'framer-motion';
import { Terminal, Zap, Shield, Cpu } from 'lucide-react';

const Hero = () => {
  return (
    <section className="hero">
      <div className="container">
        <motion.div 
          className="hero-content"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <div className="hero-logo">
            <motion.div 
              className="logo-ascii"
              initial={{ scale: 0.8 }}
              animate={{ scale: 1 }}
              transition={{ duration: 1, delay: 0.2 }}
            >
              <pre className="ascii-art">
{`╔══════════════════════════════════════════════════╗
║                                                  ║
║    ██╗███╗   ██╗ ██████╗ ███████╗███╗   ██╗     ║
║    ██║████╗  ██║██╔════╝ ██╔════╝████╗  ██║     ║
║    ██║██╔██╗ ██║██║  ███╗█████╗  ██╔██╗ ██║     ║
║    ██║██║╚██╗██║██║   ██║██╔══╝  ██║╚██╗██║     ║
║    ██║██║ ╚████║╚██████╔╝███████╗██║ ╚████║     ║
║    ╚═╝╚═╝  ╚═══╝ ╚═════╝ ╚══════╝╚═╝  ╚═══╝     ║
║                                                  ║
║        ⚡ Ingenuity x Llama Agent v3.0 ⚡        ║
║              Professional Edition                 ║
║                                                  ║
╚══════════════════════════════════════════════════╝`}
              </pre>
            </motion.div>
          </div>

          <motion.h1 
            className="hero-title"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            AI Agent
            <br />
            <span className="gradient-text">for Developers</span>
          </motion.h1>

          <motion.p 
            className="hero-description"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
          >
            Modern C++ AI agent with language model integration, secure command execution, 
            and comprehensive system tools.
          </motion.p>

          <motion.div 
            className="hero-stats"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.8 }}
          >
            <div className="stat">
              <Terminal className="stat-icon" />
              <div>
                <div className="stat-number">13+</div>
                <div className="stat-label">Commands</div>
              </div>
            </div>
            <div className="stat">
              <Zap className="stat-icon" />
              <div>
                <div className="stat-number">2</div>
                <div className="stat-label">AI Modes</div>
              </div>
            </div>
            <div className="stat">
              <Shield className="stat-icon" />
              <div>
                <div className="stat-number">100%</div>
                <div className="stat-label">Secure</div>
              </div>
            </div>
            <div className="stat">
              <Cpu className="stat-icon" />
              <div>
                <div className="stat-number">C++17</div>
                <div className="stat-label">Modern</div>
              </div>
            </div>
          </motion.div>

          <motion.div 
            className="hero-actions"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 1 }}
          >
            <a href="#installation" className="btn btn-primary">
              <Terminal size={20} />
              Get Started
            </a>
            <a href="#features" className="btn btn-secondary">
              <Zap size={20} />
              Features
            </a>
          </motion.div>
        </motion.div>
      </div>

      <style jsx>{`
        .hero {
          min-height: 100vh;
          display: flex;
          align-items: center;
          position: relative;
          background: radial-gradient(circle at 50% 50%, rgba(0, 212, 255, 0.08) 0%, transparent 50%);
        }

        .hero-content {
          text-align: center;
          max-width: 800px;
          margin: 0 auto;
        }

        .hero-logo {
          margin-bottom: 48px;
        }

        .ascii-art {
          font-family: 'JetBrains Mono', monospace;
          font-size: 0.7rem;
          color: #00d4ff;
          text-shadow: 0 0 8px rgba(0, 212, 255, 0.4);
          line-height: 1.2;
          margin: 0;
        }

        .hero-title {
          font-size: 3.25rem;
          font-weight: 700;
          color: white;
          margin-bottom: 24px;
          line-height: 1.1;
          letter-spacing: -0.02em;
        }

        .hero-description {
          font-size: 1.125rem;
          color: #b0b0b0;
          margin-bottom: 48px;
          max-width: 560px;
          margin-left: auto;
          margin-right: auto;
          line-height: 1.6;
        }

        .hero-stats {
          display: flex;
          justify-content: center;
          gap: 32px;
          margin-bottom: 48px;
          flex-wrap: wrap;
        }

        .stat {
          display: flex;
          align-items: center;
          gap: 12px;
          padding: 20px 24px;
          background: rgba(255, 255, 255, 0.04);
          border: 1px solid rgba(255, 255, 255, 0.08);
          border-radius: 12px;
          backdrop-filter: blur(8px);
        }

        .stat-icon {
          color: #00d4ff;
        }

        .stat-number {
          font-size: 1.375rem;
          font-weight: 600;
          color: white;
        }

        .stat-label {
          font-size: 0.875rem;
          color: #888;
          font-weight: 400;
        }

        .hero-actions {
          display: flex;
          gap: 16px;
          justify-content: center;
          flex-wrap: wrap;
        }

        @media (max-width: 768px) {
          .hero-title {
            font-size: 2.5rem;
          }

          .ascii-art {
            font-size: 0.5rem;
          }

          .hero-stats {
            gap: 24px;
          }

          .stat {
            padding: 16px 20px;
          }
        }

        @media (max-width: 480px) {
          .hero-title {
            font-size: 2rem;
          }

          .ascii-art {
            font-size: 0.4rem;
          }

          .hero-actions {
            flex-direction: column;
            align-items: center;
          }
        }
      `}</style>
    </section>
  );
};

export default Hero;
